// ✅ ReviewPanel.js — Show full order before print/WhatsApp

import React from "react";
import exportToCSV from '../utils/exportToCSV';
const handleWhatsappSend = () => {
  const valid = cart.every(item =>
    item.entries.every(e => e.batch && (e.qty > 0 || e.ctn > 0))
  );
  if (!valid) {
    showToast("⚠️ Fill batch, qty or CTN");
    return;
  }

  // 🧾 Create CSV file and download
  exportToCSV(cart, dealer["Dealer Name"], vehicleName, vehicleNumber, notes);

  // 🧾 Build message
  let msg = `🛒 Jai Ayurved Factory Dispatch\n\n`;
  cart.forEach(item => {
    msg += `🔹 ${item.name}\n`;
    item.entries.forEach(entry => {
      msg += `   📦 Batch: ${entry.batch} | Qty: ${entry.qty} | CTN: ${entry.ctn}\n`;
    });
  });
  msg += `\n🚛 Vehicle: ${vehicleName} (${vehicleNumber})`;
  msg += `\n📦 Total CTNs: ${totalCTN}`;
  if (notes) msg += `\n📝 Notes: ${notes}`;
  msg += `\n\n📥 *CSV file downloaded — attach before sending*`;

  const adminNumber = "919929988408"; // Replace with actual admin number
  const url = `https://wa.me/${adminNumber}?text=${encodeURIComponent(msg)}`;
  window.open(url, "_blank");

  resetCart();
  setTab("categories");
};

export default function ReviewPanel({
  cart,
  vehicleName,
  vehicleNumber,
  notes,
  onPrint,
  onSendWhatsapp
}) {
  const totalCTN = cart.reduce((sum, item) =>
    sum + item.entries.reduce((eSum, e) => eSum + (e.ctn || 0), 0), 0);

  return (
    <div className="max-w-3xl mx-auto bg-white rounded-xl shadow-md p-6 space-y-4 print:text-sm">
      <h2 className="text-xl font-bold text-center border-b pb-2">📋 Order Review</h2>

      {cart.map((item, i) => (
        <div key={i} className="border p-3 rounded-md bg-gray-50">
          <h3 className="font-semibold text-gray-800">{item.name}</h3>
          <table className="w-full mt-2 text-sm">
            <thead>
              <tr className="text-left text-gray-500">
                <th>Batch</th>
                <th>Qty</th>
                <th>CTN</th>
              </tr>
            </thead>
            <tbody>
              {item.entries.map((entry, idx) => (
                <tr key={idx} className="border-t">
                  <td className="py-1">{entry.batch}</td>
                  <td className="py-1">{entry.qty}</td>
                  <td className="py-1">{entry.ctn}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ))}

      <div className="mt-6 space-y-1">
        <p><strong>🚛 Vehicle:</strong> {vehicleName}</p>
        <p><strong>🔢 Vehicle Number:</strong> {vehicleNumber}</p>
        <p><strong>📦 Total CTNs:</strong> {totalCTN}</p>
        {notes && <p><strong>📝 Notes:</strong> {notes}</p>}
      </div>

      <div className="flex justify-center gap-4 mt-6 print:hidden">
        <button
          onClick={onPrint}
          className="bg-gray-200 hover:bg-gray-300 px-5 py-2 rounded text-sm"
        >🖨 Print</button>
        <button
          onClick={onSendWhatsapp}
          className="bg-green-600 hover:bg-green-700 text-white px-5 py-2 rounded text-sm"
        >📲 Send to WhatsApp</button>
      </div>
    </div>
  );
}
